# Issue Tracker
class IssueTracker:
    def __init__(self):
        self.issues = []

    def add_tech_thursday_issue(self, description: str, priority: int):
        self.issues.append({
            'description': description,
            'priority': priority,
            'date': datetime.now(),
            'status': 'Open'
        })

    def get_priority_issues(self, min_priority: int) -> List[dict]:
        return [issue for issue in self.issues if issue['priority'] >= min_priority]

# Testing Coordinator
class TestingCoordinator:
    def __init__(self):
        self.sessions = {}

    def schedule_testing_session(self, participant: str, feature: str, date: str):
        session_id = hashlib.md5(f"{participant}{feature}{date}".encode()).hexdigest()
        self.sessions[session_id] = {
            'participant': participant,
            'feature': feature,
            'date': date,
            'feedback': None
        }
        return session_id

    def record_feedback(self, session_id: str, feedback: str):
        if session_id in self.sessions:
            self.sessions[session_id]['feedback'] = feedback

