# Historical Data Loader
class HistoricalDataLoader:
    def __init__(self, db_manager: DatabaseManager):
        self.db = db_manager

    def load_fpds_data(self, years: List[int], csv_path: str):
        data = pd.read_csv(csv_path)
        filtered = data[data['year'].isin(years)]
        filtered.to_sql('historical_fpds', self.db.connection, if_exists='append', index=False)

