# Cached File Generator
class DFileGenerator:
    def __init__(self, cache_dir: str):
        self.cache_dir = cache_dir
        os.makedirs(cache_dir, exist_ok=True)

    @cached(cache=TTLCache(maxsize=100, ttl=3600))
    def generate_d_file(self, params: dict) -> str:
        cache_key = hashlib.md5(json.dumps(params).encode()).hexdigest()
        cache_path = os.path.join(self.cache_dir, f"{cache_key}.json")

        if os.path.exists(cache_path):
            with open(cache_path, 'r') as f:
                return f.read()

        # Simulate generating the file
        result = json.dumps({"data": "generated content based on params"})
        with open(cache_path, 'w') as f:
            f.write(result)
        return result

